import { Link } from 'react-router-dom';
import styled from 'styled-components';
import logo from './webscript.png';

const StyleLink = styled(Link)`
  font-size: #ffc000;
  font-weight: 700;
  color: #f31700;
  min-height: 48px;
  display: flex;
  align-items: lift;
  padding: 0 20px 0 25px;
  border-bottom: rgba(255, 255, 255, 0.1) 1px solid;
  &:hover {
    text-decoration: none;
  }
  .logo {
    display: flex;
    position: absolute;
    top: 8px;
    left: 0%;
    height: 40px;
    width: 100px;
    align-items: center;
    justify-content: center;
    border-radius: 10px;
    box-shadow: 0px 1px 2px 0px rgba(51, 51, 51, 0.5);

    span {
      font-weight: 500;
      color: rgba(255,255,255, .9);
      opacity: ${(p) => Number(!p.compact)};
      transition: opacity 0.3s cubic-bezier(0.4, 0, 1, 1);

      @media(max-width: ${bp.desktop}) {
        span {
            opacity: 1;
        }
    }

    h3 {
      color:#ffc000 ;
      letter-spacing: 2px;
      font-size: 1.6em;
    }

    img {
      height: 34px;
      width: 34px;
      margin-right: 10px;
      object-fit: cover;
    }
  }
`;

function Logo() {
  return (
    <StyleLink to="/">
      <div className="logo">
        <span>StoreLord</span>
        <img src={logo} alt="webscript" />
      </div>
    </StyleLink>
  );
}

export default Logo;
